text:
 @rodriguesgomes4178  Fortaleza é um time muito bom tecnicamente,mas não dá pra manter intensidade em todos os jogos,ainda mais jogando no Maracanã onde o flamengo é extremamente forte.O que isso é mostrado também no Castelão,vencendo adversários fortes e fora de casa tmb.Agoda vc falar que  o time não joga buscando jogo é no mínimo desinformação,quanto ao todo.
Fortaleza é um dos times que tem um rendimento muito acima da média com sua receita(que é baixa comparado a outros clubes)
Agora vc querer que o time que vale 4,5,6 veze menos que clubes como o flamengo tenha a mesma qualidade técnica e eficácia que ele,aí não dá né parceiro.

 @alexdibui  Que inventar, animal???
Olha a porra do lance do pênalti, cretino.
Aos 26 segundos você pausa o lance e verá o Wesley França inteiro dentro da área, enquanto o Yago Pikachu ainda nem tinha cobrado.

 @isabellibernardino9607  Ohh cabaça.
Aos 26 segundos, PAUSA o vídeo.
O Wesley França estava INTEIRO dentro da área ANTES do Yago Pikachu bater na bola.

 @celsogouveajunior6754  Claro,até porque o time do Palmeiras não ganhou do Chelsea no mundi por ser um time horrível, e não pelo Chelsea ter um orçamento de mais de 1 bilhão, e o Palmeiras valer 5,6 vezes menos,acredita?Realmente o nível técnico dos jogadores e gestão não implicam,
Então porque não pegamos o Paysandu e colocamos contra o Atlético PR por exemplo,se ele tomar goleada,é desculpa.
Óbviamente o flamengo tem todo o mérito da vitória,meu comentário foi apenas uma observação e não uma desculpa,para mostrar que vários fatores implicam no desenvolvimento do time,seja qual for ele.

 @hugoresendecavalcante3762  é exatamente por isso que eu citei que o Fortaleza faz muito acima da média com sua baixa receita,
Enquanto existem clubes que tem uma receita muito maior e faz mais ou não faz tanto quanto deveria,gênio.
Não preciso desenhar né?

 @Forlan21647  Botafogo n aguenta mais 5 rodadas kkkkkkkkkk
time fracassado, n ganha nada, só teve sorte até agora. com esse elenco meia tigela ai vai cair jaja
uma derrota seguida da outra kkkkkkkkkkk

 @rodriguesgomes4178  Por isso que eu citei a parte de Gestão,porque para clubes que tem um renda muito inferior a clubes ricos do Brasil possa brigar com eles,é necessário uma ótima gestão.Diferente de times como Atlético PR,Flamengo,Atlético MG,Palmeiras.
Que a cada janela de transferências contraram jogadores de mais alto nível,e quando necessitam de um técnico bom,tem dinheiro para contratar os melhores.
Agora vc acha que times como Bahia,Ceará,Sport, e o Fortaleza tem as mesmas ferramentas para fazer o mesmo?E mesmo assim muitas vezes  conseguem se sobressair entre os melhores do Brasil,por isso que a parte de Gestão é extremamente importante para qualquer time do Brasil,mas em específico a times que tem menos recursos.
